import React from 'react'
import { useSelector } from 'react-redux'

function ProductListing() {
    const {product} = useSelector(state=>state.product)
    console.log(product)
    return (
        <div>
            <h1>Product Listing</h1>
        </div>
    )
}

export default ProductListing
